  false,\n\t\"url\": null,\n\t\"notes\": \"This 2' gravity density grid for Puerto
  Rico and the Virgin Islands displays the distribution of about 26,000 terrestrial
  and marine gravity data held in the National Geodetic Survey gravity data base in
  July 1996. These data were augmented by gravity data contributions from NGA (former
  National Imagery and Mapping Agency (former Defence Mapping Agency)) and by satellite
  altimeter-derived marine gravity anomalies computed by Sandwell and Smith (1996).
  The values show the number of gravity data contained in a given 2' cell. Additional
  information is available at http://www.ngs.noaa.gov/GEOID/geoid.htmlWe are particularly
  grateful to NGA (former National Imagery and Mapping Agency) for their assistance
  and their data contributions.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
